import React from 'react'

function ProductList({ products }) {
  return (
    <div className='product-list'>
      {products.map((product) => (
        <div key={product.id} className='prodct-card'>
          <h3>{product.name}</h3>
        </div>
      ) )}
    </div>
  )
}

export default ProductList
